      alertCont.className = 'OldBrowser';
      alertCont.id = 'old_browser_wrap';
      alertCont.innerHTML = alert;
      document.body.appendChild(alertCont);
      trackOldBrowserEvent('showAlert_atom');
    }
  } catch(e) {}
}
setTimeout(checkOldBrowser, 0);
})();
